import React from 'react';
import {
  HeaderContainer,
  HeaderTitle,
  HeaderWrapper,
  MypageLink,
  Search,
} from './HeaderStyle';

const Header: React.FC = () => {
  return (
    <HeaderContainer>
      <HeaderWrapper>
        <HeaderTitle>PICFast</HeaderTitle>
        <Search placeholder="검색하기" />
        <MypageLink to="/mypage">마이페이지</MypageLink>
      </HeaderWrapper>
    </HeaderContainer>
  );
};

export default Header;
